INSERT INTO Chat(chatId, content, latitude, longitude, memberId, createdAt, lastModifiedAt) VALUES
(1, '여기 너무 좋다!', 37.566535, 126.977969, 1, '2024-03-14T19:52:58.9517531', '2024-03-14T19:55:58.9517531'),
(2, '서울의 밤은 언제나 아름답다.', 37.566535, 126.977969, 2, '2024-03-14T20:00:00.0000000', '2024-03-14T20:05:00.0000000'),
(3, '부산 해운대의 풍경은 정말 멋져!', 35.158698, 129.160384, 3, '2024-03-14T20:10:00.0000000', '2024-03-14T20:15:00.0000000'),
(4, '제주도에서의 여행이 너무 기대돼요!', 33.499621, 126.531188, 4, '2024-03-14T20:20:00.0000000', '2024-03-14T20:25:00.0000000'),
(5, '한강에서 자전거 타는 것이 최고입니다.', 37.551169, 126.988226, 5, '2024-03-14T20:30:00.0000000', '2024-03-14T20:35:00.0000000'),
(6, '경복궁의 역사적인 분위기가 너무 좋아요.', 37.579617, 126.977041, 6, '2024-03-14T20:40:00.0000000', '2024-03-14T20:45:00.0000000'),
(7, '여긴 너무 시끄럽다!', 37.566535, 126.977969, 7, '2024-03-14T20:50:00.0000000', '2024-03-14T20:55:00.0000000'),
(8, '이곳은 정말 한적하고 평화로워요.', 35.179554, 129.075641, 8, '2024-03-14T21:00:00.0000000', '2024-03-14T21:05:00.0000000'),
(9, '한라산 등반은 정말 힘들었지만 보람찼어요.', 33.499621, 126.531188, 9, '2024-03-14T21:10:00.0000000', '2024-03-14T21:15:00.0000000'),
(10, '서울에서의 밤샘 파티!', 37.566535, 126.977969, 10, '2024-03-14T21:20:00.0000000', '2024-03-14T21:25:00.0000000'),
(11, '대구의 밤이 이렇게 아름다울 줄이야!', 35.871435, 128.601445, 11, '2024-03-14T21:30:00.0000000', '2024-03-14T21:35:00.0000000'),
(12, '광안리 해변에서 보는 석양은 정말 멋져!', 35.153255, 129.118618, 12, '2024-03-14T21:40:00.0000000', '2024-03-14T21:45:00.0000000'),
(13, '서울의 여름은 덥다!', 37.566535, 126.977969, 13, '2024-03-14T21:50:00.0000000', '2024-03-14T21:55:00.0000000'),
(14, '부산의 밤은 항상 활기차다!', 35.158698, 129.160384, 14, '2024-03-14T22:00:00.0000000', '2024-03-14T22:05:00.0000000'),
(15, '여기 음식이 너무 맛있어요!', 37.566535, 126.977969, 15, '2024-03-14T22:10:00.0000000', '2024-03-14T22:15:00.0000000'),
(16, '제주도에서의 드라이브는 정말 멋져!', 33.499621, 126.531188, 16, '2024-03-14T22:20:00.0000000', '2024-03-14T22:25:00.0000000'),
(17, '한강에서의 산책이 너무 좋아요.', 37.551169, 126.988226, 17, '2024-03-14T22:30:00.0000000', '2024-03-14T22:35:00.0000000'),
(18, '경복궁의 야경은 정말 멋지다.', 37.579617, 126.977041, 18, '2024-03-14T22:40:00.0000000', '2024-03-14T22:45:00.0000000'),
(19, '여기 너무 춥다!', 37.566535, 126.977969, 19, '2024-03-14T22:50:00.0000000', '2024-03-14T22:55:00.0000000'),
(20, '이곳은 너무 더워!', 35.179554, 129.075641, 20, '2024-03-14T23:00:00.0000000', '2024-03-14T23:05:00.0000000'),
(21, '한라산 정상에서 보는 경치는 최고야.', 33.499621, 126.531188, 21, '2024-03-14T23:10:00.0000000', '2024-03-14T23:15:00.0000000'),
(22, '서울에서의 쇼핑은 정말 재밌어요!', 37.566535, 126.977969, 22, '2024-03-14T23:20:00.0000000', '2024-03-14T23:25:00.0000000'),
(23, '대구에서의 야경은 정말 멋져!', 35.871435, 128.601445, 23, '2024-03-14T23:30:00.0000000', '2024-03-14T23:35:00.0000000'),
(24, '광안리에서의 불꽃놀이가 최고였어!', 35.153255, 129.118618, 24, '2024-03-14T23:40:00.0000000', '2024-03-14T23:45:00.0000000'),
(25, '서울의 가을은 너무 예뻐요.', 37.566535, 126.977969, 25, '2024-03-14T23:50:00.0000000', '2024-03-14T23:55:00.0000000'),
(26, '부산의 여름은 덥고 습해!', 35.158698, 129.160384, 26, '2024-03-15T00:00:00.0000000', '2024-03-15T00:05:00.0000000'),
(27, '여기 정말 조용하고 평화로워요.', 37.566535, 126.977969, 27, '2024-03-15T00:10:00.0000000', '2024-03-15T00:15:00.0000000'),
(28, '제주도에서 먹는 음식은 정말 맛있어!', 33.499621, 126.531188, 28, '2024-03-15T00:20:00.0000000', '2024-03-15T00:25:00.0000000'),
(29, '한강에서 자전거 타는 것이 너무 즐거워요.', 37.551169, 126.988226, 29, '2024-03-15T00:30:00.0000000', '2024-03-15T00:35:00.0000000'),
(30, '경복궁의 야경을 보러 오세요.', 37.579617, 126.977041, 30, '2024-03-15T00:40:00.0000000', '2024-03-15T00:45:00.0000000'),
(31, '여기 사람 너무 많아!', 37.566535, 126.977969, 31, '2024-03-15T00:50:00.0000000', '2024-03-15T00:55:00.0000000'),
(32, '이곳은 너무 혼잡해요.', 35.179554, 129.075641, 32, '2024-03-15T01:00:00.0000000', '2024-03-15T01:05:00.0000000'),
(33, '한라산의 경치가 너무 아름다워요.', 33.499621, 126.531188, 33, '2024-03-15T01:10:00.0000000', '2024-03-15T01:15:00.0000000'),
(34, '서울에서의 문화체험이 너무 재밌어요.', 37.566535, 126.977969, 34, '2024-03-15T01:20:00.0000000', '2024-03-15T01:25:00.0000000'),
(35, '대구의 밤거리는 정말 활기차다!', 35.871435, 128.601445, 35, '2024-03-15T01:30:00.0000000', '2024-03-15T01:35:00.0000000'),
(36, '광안리에서의 서핑이 너무 재밌어요!', 35.153255, 129.118618, 36, '2024-03-15T01:40:00.0000000', '2024-03-15T01:45:00.0000000'),
(37, '서울의 겨울은 춥지만 아름다워요.', 37.566535, 126.977969, 37, '2024-03-15T01:50:00.0000000', '2024-03-15T01:55:00.0000000'),
(38, '부산의 밤은 정말 매력적이에요.', 35.158698, 129.160384, 38, '2024-03-15T02:00:00.0000000', '2024-03-15T02:05:00.0000000'),
(39, '여기 너무 더워!', 33.499621, 126.531188, 39, '2024-03-15T02:10:00.0000000', '2024-03-15T02:15:00.0000000'),
(40, '한강에서의 피크닉이 최고에요.', 37.551169, 126.988226, 40, '2024-03-15T02:20:00.0000000', '2024-03-15T02:25:00.0000000'),
(41, '경복궁의 역사적인 분위기가 너무 좋다.', 37.579617, 126.977041, 41, '2024-03-15T02:30:00.0000000', '2024-03-15T02:35:00.0000000'),
(42, '여기 사람 너무 많아요!', 37.566535, 126.977969, 42, '2024-03-15T02:40:00.0000000', '2024-03-15T02:45:00.0000000'),
(43, '이곳은 너무 시끄럽다.', 35.179554, 129.075641, 43, '2024-03-15T02:50:00.0000000', '2024-03-15T02:55:00.0000000'),
